import React from "react";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import ImageSource from "../Assets/img3.jpg";
function image() {
  return (
    <div>
      <Card className="container mt-5" style={{ width: "18rem" }}>
        <Card.Img variant="top" source={ImageSource} />
        <Card.Body>
          <Card.Title>Image One</Card.Title>
          <div className="row">
            <Button>Delete</Button>
            <Button>Edit</Button>
          </div>
        </Card.Body>
      </Card>
    </div>
  );
}

export default image;
